I come before You this morning, feeling blessed and grateful for Your boundless love and guidance. You are the light that shines in my life, directing my path with wisdom and grace.

I humbly ask for Your forgiveness for my shortcomings and seek Your strength to grow in faith. May I always trust in Your plan, even when the future seems uncertain.

Thank You for the blessings of friendship and family, which bring joy and support to my journey. I am truly grateful for Your unwavering presence in my life.

I lift my future to You, seeking strength and faith as I move forward. For Ben Cohen, I pray for joy as he transitions from Killabears, and for Bryan, I ask for success in his new landscaping business. Grant him patience and wisdom as a father and husband.

I pray for peace and unity in our divided country, and in my personal life, I seek Your calming presence to bring healing in the midst of chaos and separation from my wife.

Please give my Mama the strength to support me in this new chapter, surrounding her with love and courage.

In all these intentions, I trust in Your perfect will and divine love.

Amen.', NULL, NULL, '2025-05-30 08:13:56.124823+00', NULL, '{"slot": "morning", "source": "subsequent-prayer", "detailedChangesContext": [], "changesFromReviewScreen": {}, "dbProfileMoodAtGeneration": "blessed"}'),
