	('9dc79b67-c710-4b9b-a58a-8934a2bdfab2', 'cc535b46-2b2d-4295-b4af-5527ac3e312d', 'evening', 'Dear Loving Father,

As the day comes to a close, I come before You with a heart full of gratitude. Thank You for the blessing of my new apartment, a place to create fresh memories and new beginnings. Though its bittersweet due to my separation from my wife, I trust in Your plan and guidance.

I am deeply thankful for my dad, who has been there every step of the way, helping me move. Grant him patience and strength as he supports me through this transition.

I lift up my friend Ben Cohen as he awaits the testflight build of our new app, personalprayers. Bless him with patience and assurance as we move forward on this exciting journey.

I pray for my sister Annmarie, as she nurtures and cares for her three kids. May she find patience and joy amidst her busy days, and may You bless her home with love and laughter.

I ask for Your hand of success and guidance upon my friend Bryan as he embarks on his new landscaping business. May his efforts flourish and meet with great success.

Lord, please reassure my mom, easing her worries and filling her heart with faith and peace. Let her know that I am in Your care and will be okay no matter what.

Thank You for Your endless love and presence in our lives. May we rest tonight in Your comforting embrace, ready for the new day ahead.

In Jesus'' name, Amen.', NULL, NULL, '2025-06-04 23:30:28.717774+00', '2025-06-04 23:32:15.089+00', '{"slot": "evening", "source": "subsequent-prayer", "activeIntentions": [{"id": "7dbe6a1c-a14c-4700-beef-00f2622ca8f5", "details": "Helping me move into my new apartment", "user_id": "cc535b46-2b2d-4295-b4af-5527ac3e312d", "category": "patience", "is_active": true, "person_id": "b23fdf5c-fe5b-4281-8109-b3ca60b964de", "created_at": "2025-06-04T09:33:57.802475+00:00", "prayer_focus_people": {"name": "Dad", "gender": "he", "relationship": "Dad"}}, {"id": "91b36f42-5622-4b40-9400-57f6de231d44", "details": "Waiting for the testflight build of our new app personalprayers", "user_id": "cc535b46-2b2d-4295-b4af-5527ac3e312d", "category": "patience", "is_active": true, "person_id": "56a378cd-a755-4423-b95e-3d7b81e19895", "created_at": "2025-06-04T09:35:37.297269+00:00", "prayer_focus_people": {"name": "Ben Cohen", "gender": "Other", "relationship": "Friend"}}, {"id": "fe317414-c0c7-4724-8ca5-6f151deaa0eb", "details": "As a mom of 3 kids", "user_id": "cc535b46-2b2d-4295-b4af-5527ac3e312d", "category": "patience", "is_active": true, "person_id": "98f25ebf-62f0-498f-98f1-255f9632dc95", "created_at": "2025-06-04T09:57:04.005374+00:00", "prayer_focus_people": {"name": "Annmarie", "gender": "she", "relationship": "Sister"}}, {"id": "33555207-dd0c-4d50-b2ec-1b165e48f385", "details": "In his new landscaping business", "user_id": "cc535b46-2b2d-4295-b4af-5527ac3e312d", "category": "success", "is_active": true, "person_id": "350018a6-e85b-4267-90ac-46963fc52bd0", "created_at": "2025-06-04T09:57:53.139811+00:00", "prayer_focus_people": {"name": "Bryan", "gender": "Other", "relationship": "Friend"}}, {"id": "2f8f9644-73f3-4ba9-9d5c-9177f5337cf4", "details": "In knowing I am going to be ok no matter what", "user_id": "cc535b46-2b2d-4295-b4af-5527ac3e312d", "category": "faith", "is_active": true, "person_id": "0d0a2d66-c061-4120-a149-6b2bd59c21b9", "created_at": "2025-06-04T09:58:52.244695+0