	('df2e630a-9470-4210-b4bd-8f31edcbea54', 'cc535b46-2b2d-4295-b4af-5527ac3e312d', 'morning', 'Dear Heavenly Father,

I come before You this morning, Jason, with a heart full of hope and gratitude for this fresh start. I praise You, Lord, for Your boundless love and for the light that breaks through the darkness, guiding our paths with Your eternal wisdom. You are the Creator of new beginnings and endless possibilities, and I marvel at Your power to renew and restore. Thank You for being the unwavering rock upon which I can stand.

Father, I want to confess the struggles Ive been holding, the moments of doubt and fear that sometimes cloud my faith. I acknowledge my need for Your grace, especially as I work through the trauma I''ve faced. Help me to trust You more deeply and to lean into Your strength rather than my own. Forgive me for any times I have faltered, Lord, and teach me to walk in Your peace.

With a thankful heart, I give You praise for bringing me to this moment of new beginnings. Thank You for this new apartment where I hope to work in peace and build the company Ive always dreamed of. I see Your hand guiding me, and I am grateful. Thank You for the blessings that have come even through challenging times. Your faithfulness has been my anchor.

Lord, I lift up to You my needs and desires. I ask for healing from the trauma that has weighed on my spirit. Fill me with Your peace and surround me with Your comfort. Guide me to places of rest and renewal, where I can find true healing in Your presence. 

I also bring before You a personal request about Yasso, our beloved dog. I pray that my wifes heart may be open and understanding, and that we may reach a place of agreement that allows Yasso to be with me. Let this situation be filled with Your blessing, and may Your will be done.

I pray for my mother, Mama, who is under great stress from her work. Grant her the peace that surpasses all understanding. May she find moments of tranquility and strength amidst her demanding schedule. Surround her with supportive colleagues and friends, and help her to find balance and rest.

Lord, I trust in You, knowing that You are working all things together for good. As I step into this new chapter, I ask for Your guidance and wisdom. Lead me in building my company with integrity and purpose, that it may reflect Your glory and serve others in meaningful ways.

Thank You for hearing my prayers, for knowing my heart, and for always being near. May Your peace envelop me today and in all the days to come.

In Jesus name,  
Amen.', NULL, NULL, '2025-06-03 07:41:50.831454+00', NULL, '{"slot": "morning", "source": "first-prayer-regular", "activeIntentions": [{"id": "d8545bf8-abd6-4549-ba11-daa68a322ece", "details": "Healing from recent trauma", "user_id": "cc535b46-2b2d-4295-b4af-5527ac3e312d", "category": "peace", "is_active": true, "person_id": null, "created_at": "2025-06-03T07:39:21.09714+00:00", "prayer_focus_people": null}, {"id": "0876bb1d-94e7-4bb9-a139-1bdb4e4eb2b7", "details": "For my wife to let me have our dog Yasso", "user_id": "cc535b46-2b2d-4295-b4af-5527ac3e312d", "category": "blessing", "is_active": true, "person_id": null, "created_at": "2025-06-02T10:46:53.24967+00:00", "prayer_focus_people": null}, {"id": "6aa68f3f-82c9-48cd-8d94-6c51a85b1ea9", "details": "Her work is stressing her out", "user_id": "cc535b46-2b2d-4295-b4af-5527ac3e312d", "category": "peace", "is_active": true, "person_id": "0d0a2d66-c061-4120-a149-6b2bd59c21b9", "created_at": "2025-06-03T05:22:32.119564+00:00", "prayer_focus_people": {"name": "Mama", "gender": "she", "relationship": "Mom"}}], "dbProfileMoodAtGeneration": "hopeful"}'),
	('8cd9834f-f7e4-4e71-a000-e6fea89135e8', 'cc535b46-2b2d-4295-b4af-5527ac3e312d', 'morning', 'Dear Heavenly Father,

