	('22da7079-ce14-4ace-af84-73e711c81efa', 'cc535b46-2b2d-4295-b4af-5527ac3e312d', 'evening', 'Dear Gracious Father,

As the day ends, my heart overflows with gratitude. Thank You for the countless blessings and the love and support that surrounds me.

I''m especially grateful for my mom, whose help in moving into my new apartment has made it feel like home. Her caring nature and unwavering support are true gifts, and I ask that You reassure her of my well-being, filling her heart with faith and peace.

I lift up my sister Annmarie, asking for patience as she cares for her three kids. May she find strength and joy in her daily tasks.

For my friend Ben Cohen, I pray for patience as he waits for the testflight build of our app, personalprayers. Guide us both as we work together, knowing that Your hand is in all things.

Bless my friend Bryan with strength as a father and with success in his new landscaping business. May he find fulfillment and joy in all his endeavors.

I also pray for Yasso, my beloved dog. Grant him peace in our old home and ensure that my wifes care is gentle and calming for him.

